    data: |
      SELECT DISTINCT - tab1.col1 + ( - cor0.col1 ) AS col2 FROM tab1, tab1 AS cor0;
  - name: tab1

outputs:
  - name: q565.out
    data: |
      -20
      -23
      -26
      -36
      -39
      -52
